import Link from 'next/link';

const Index = () => (
    <div style={{fontSize: '20px', fontFamily: 'sans-serif'}}>
        <h1>SSR Magician</h1>
        <Link href='/about'>
            <a>About</a>
        </Link>
        <Link href='/robots'>
            <a>Robots</a>
        </Link>
    </div>
);

export default Index;
